CREATE DATABASE PAPELERIA
create table PRODUCTO(
	IDPRODUCTO NUMBER,
	IDCLIENTE NUMBER,
	RFCEMPRESA VARCHAR(50),
	CODIGODEBARRAS VARCHAR(50),
	DESCUENTO NUMBER,
	PRECIO VARCHAR(50),
	INVENTARIO VARCHAR(50),
	MARCA VARCHAR(50),
	CONSTRAINT PRODUCTO_PK PRIMARY KEY (IDPRODUCTO));



create table PEDIDO(
	NUMPEDIDO NUMBER,
	IDCLIENTE NUMBER,
	CODIGOINV NUMBER,
	CANTIDAD NUMBER,
	TOTAL NUMBER,
	CODIGO VARCHAR(50),
	CONSTRAINT PEDIDO_PK PRIMARY KEY(NUMPEDIDO));
    

create table INVENTARIO (
	CODIGOINV NUMBER,
	IDPRODUCTO NUMBER,
	STOCK NUMBER,
	FECHA DATE,
	UNIDADES NUMBER,
	PRECIOCOMPRA NUMBER,
	NUMINVETARIO NUMBER,
	CONSTRAINT INVENTARIO_PK PRIMARY KEY (CODIGOINV)
);

select * from ventas;

create table ENTREGAS (
	NUMPEDIDO NUMBER,
	IDCLIENTE NUMBER,
	TELEFONOCLIENTE VARCHAR(50),
	ENTIDAD VARCHAR(50),
	COLONIA VARCHAR(50),
	CALLE VARCHAR(50),
	MUNICIPIO VARCHAR(50),
	NUMEXTERIOR VARCHAR(50),
	NUMINTERIOR VARCHAR(50),
	NOMBRECLIENTE VARCHAR(50),
	CONSTRAINT ENTREGAS_PK PRIMARY KEY (NUMPEDIDO)
);


create table PROVEEDORES (
	RFCEMPRESA NUMBER,
	IDPRODUCTO NUMBER,
	COMPANIAPROVEEDOR NUMBER,
	NOMBREPROVEEDOR NUMBER,
	TELEFONOPROVEEDOR NUMBER,
